            // Function to insert games only if they don´t already exist
            fun insertarSinDuplicados(juegos: List<VJuegoEntity>) {
                CoroutineScope(Dispatchers.IO).launch {
                    juegos.forEach { juego ->
                        // Check if the game already exists by title and platform
                        val existente = vJuegoDao.obtenerPorTituloYPlataforma(juego.titulo, juego.plataforma)
                        if (existente == null) {
                            // Insert new game if it doesn't exist
                            vJuegoDao.agregarVJuego(juego)
                        } else {
                            println("El juego '${juego.titulo}' para '${juego.plataforma}' ya existe.")
                        }
                    }
                }
            }

            // Insert default games without duplicate
            insertarSinDuplicados(listaDeVideojuegos)
        }
    }
